import '../components/App.css';
import NavBar from './Navbar/NavBar';
import Banner from './banner/Banner';
import Card from '../components/Cards/Card';
import Footer from './Footer/Footer';
function App() {
  return (
    <div className="App">
      <NavBar/>
      <Banner/>
      <Card/>
      <Footer/>
    </div>
  );
}

export default App;
